import { Switch, Route } from 'react-router-dom'

import AddQuote from './pages/AddQuote';
import AllQuotes from './pages/AllQuotes';
import Welcome from './pages/Welcome';

function App() {
  return (
    <div>
      <Switch>
        <Route path="/">
          <Welcome></Welcome>
        </Route>
        <Route path="/all-quotes">
          <AllQuotes></AllQuotes>
        </Route>
        <Route path="/add-quote">
          <AddQuote></AddQuote>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
